import React from 'react';

const Friend = (props) => {
    let styles = 'col-4 p-1 '
    if(props.pos == 7){
        styles += 'bottomLeft';
    }
    if(props.pos == 9){
        styles += 'bottomRight'
    }
    return (
        <img className={styles} src={props.picture} alt="friend"/>
    );
};

export default Friend;
